import React from 'react'
import './Product.css'

function Product({ id, title, image, price }) {
    return (
        <div className='product'>
            <p>{title}</p>
            <p className='product_price'><small>Rs </small><strong>{price}</strong></p>

            <img src={image} alt='' />

            <button>Add to basket</button>
        </div>
    )
}

export default Product
